question:
#include <atomic>
#include <thread>

std::atomic<int> x{0};
int y = 0;

void producer() {
    y = 20;
    x.store(1, std::memory_order_release);
}

void consumer() {
    while (x.load(std::memory_order_acquire) != 1) {}
    assert(y == 20);
}

int main() {
    std::thread t1(producer);
    std::thread t2(consumer);
    t1.join();
    t2.join();
    return 0;
}

